		function getContactNumberAndButtonBackgrounds() {
			selection = getContactNumberAndButtonBackgroundsObject();

			function getContactNumberAndButtonBackgroundsObject() {
				var contactNumberElements = webPage.html.selection("contactNumbers");
				var allNumberButtons = webPage.html.selection("allNumberButtons");
				var contactNumberKey;
				var conctactNumberAndButtonObject = new function () {
					this.keys = "(+61)424847756".split(""), // NB!! Specific to this number...universalize it in future versions
					this.activeKeyTextColor = webPage.html.selection("activeKeyTextColor").getAttribute("fill"),
					this.inactiveKeyTextColor = null,
					this.transitionInfo = getTransitionInfo();

					function getTransitionInfo() {
						var transitionInfo = new function () {
							this.transitionDuration = webPage.html.selection("contactNumbers")[0].style.transitionDuration;
							this.duration = webPage.regex.duration.exec(this.transitionDuration)[1];
						};

						return transitionInfo;
					}
				};
				var index;
				var buttonText;

				for (index = 0; index < conctactNumberAndButtonObject.keys.length; index ++) {
					contactNumberKey = conctactNumberAndButtonObject.keys[index];
					setUniqueContactNumberKey();

					if (contactNumberKey !== conctactNumberAndButtonObject.keys[index]) {
						conctactNumberAndButtonObject.keys[index] = contactNumberKey; // Update key if changed
					}

					conctactNumberAndButtonObject[contactNumberKey] = new function () {
						this.inputScreenValue = contactNumberElements[index];
						
						if (!webPage.regex.brackets.test(contactNumberKey)) {
							this.buttonBackground = getButtonActiveBackground();

							buttonText = this.buttonBackground.parentNode.querySelector(":scope > g > g:nth-of-type(1)");

							if (buttonText) { // 1 has no button text
								this.buttonText = nodeListToArray(buttonText.querySelectorAll("path"));
								
								if (!conctactNumberAndButtonObject.inactiveKeyTextColor) {
									conctactNumberAndButtonObject.inactiveKeyTextColor = this.buttonText[0].getAttribute("fill");
								}
							}
						}
					};
				}

				return conctactNumberAndButtonObject; 

				function setUniqueContactNumberKey() {
					if (contactNumberKey in conctactNumberAndButtonObject) {
						if (!webPage.regex.duplicate.test(contactNumberKey)) {
							contactNumberKey += "Duplicate1";
						} else {
							var duplicateRegexMatchedGroups = webPage.regex.duplicate.exec(contactNumberKey).slice(1);
							contactNumberKey = [
								duplicateRegexMatchedGroups[0], // Contact number key + 'Duplicate'
								parseInt(duplicateRegexMatchedGroups[1]) + 1, // Duplicate count
							].join("");
						}
						
						setUniqueContactNumberKey();			
					}
				}

				function getButtonActiveBackground() {
					var phoneButtonValue = webPage.regex.phoneButtonValue.exec(contactNumberKey)[1];
					var contactNumberButton = new function () {
						this["+"] = allNumberButtons[10];
						this[1] = allNumberButtons[0];
						this[2] = allNumberButtons[1];
						this[4] = allNumberButtons[3];
						this[5] = allNumberButtons[4];
						this[6] = allNumberButtons[5];
						this[7] = allNumberButtons[6];
						this[8] = allNumberButtons[7];
					};

					return contactNumberButton[phoneButtonValue].querySelector("rect:nth-of-type(2)");
				}
			}
		}

